import React from "react";
import * as bodyPix from "@tensorflow-models/body-pix";
import Stats from "stats.js";
import * as partColorScales from "../part_color_scales";
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  Button,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter
} from "reactstrap";
import Header from "components/Headers/Header.jsx";
import { Redirect } from "react-router-dom";
import axios from "axios";
import socketIOClient from "socket.io-client";
import GlobalConfig from "../config";

const line = {
  width: "2px",
  height: "100px",
  background: "black"
};

class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      modal: false
    };
  }

  choose(value) {
    if (value === 1) {
      return <Redirect to="/target" />;
      //window.location = "onboard-form";
    } else {
    }
  }

  render() {
    const instruction = this.state.instruction;
    return (
      <>
        <Header />
        <Container className="mt--7" fluid>
          <Row>
            <Col className="mb-5 mb-xl-0" xl="12">
              <Card className="shadow">
                <CardHeader className="bg-transparent">
                  <Row className="align-items-center">choose Your option</Row>
                </CardHeader>
                <CardBody>
                  <Row>
                    <Col lg="5">
                      <Button color="primary" onClick={() => this.choose(1)}>
                        ON BOARD PERSON
                      </Button>
                    </Col>
                    <Col lg="2">
                      <div style={line}></div>
                    </Col>
                    <Col lg="5">
                      <Button color="primary" onClick={() => this.choose()}>
                        IDENTIFY PERSON
                      </Button>
                    </Col>
                  </Row>
                </CardBody>
              </Card>
            </Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default Index;
